(function(n){new Vue({el:"#app",data:{oldPwd:"",newPwd1:"",newPwd2:""},methods:{ret:function(){history.go(-1)},save:function(){var t=this;if(!this.oldPwd||!this.newPwd1||!this.newPwd2){n.alert("请将表单输入完整");return}if(this.oldPwd==this.newPwd1){n.alert("新密码不能与原始密码相同");return}n.loading();axios.post(`/business/modifypassword?oldPwd=${this.oldPwd}&newPwd=${this.newPwd1}`).then(function(i){n.loaded();n.alert(i.data.msg,i.data.success?"success":"");i.data.success&&(t.oldPwd="",t.newPwd1="",t.newPwd2="")}).catch(function(t){n.loaded();n.alert(t)})}}})})(jQuery);